import React from 'react';
import { Button, makeStyles } from '@mui/material';

const useStyles = makeStyles((theme) => ({
  // Define la clase de estilo para el botón
  styledButton: {
    backgroundColor: theme.palette.primary.main, // Color de fondo
    color: '#fff', // Color del texto
    borderRadius: 8, // Borde redondeado
    padding: theme.spacing(1, 2), // Espaciado interno
    fontSize: 16,
    '&:hover': {
      backgroundColor: theme.palette.primary.dark, // Cambio de color al pasar el cursor
    },
  },
}));

function Home() {
  const classes = useStyles();

  return (
    <div>
      {/* Aplica la clase de estilo al botón */}
      <Button className={classes.styledButton} variant="contained">
        Mi botón estilizado
      </Button>
      {/* Agrega otros elementos y estilos aquí */}
    </div>
  );
}

export default Home;
